import React, { Component} from "react";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      title: ''
    }
  }

  componentDidMount() {
    fetch('/')
    .then((response) => response.json)
    .then((data) =>
      this.setState({
        title: data.title
      })
    )
  }

  render() { 
    return (
      <div>
        {this.state.title}
      </div>
    );
  }
}

export default App;
